import React from "react";
import { Route, BrowserRouter, Routes } from "react-router-dom";
import Listeencheres from "./components/Listeencheres";
import Historique from './components/Historique';
import Ficheenchere from './components/Ficheenchere';
import Formulaire from './components/Formulaire';



function App({ children }) {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path='/'>
            <Listeencheres />
          </Route>
          <Route exact path='/historique' >
            <Historique />
          </Route>
          <Route exact path='/listeenchere' element={Listeencheres}></Route>
          <Route exact path='/ficheenchere' element={Ficheenchere}></Route>
          <Route exact path='/formulaire' element={Formulaire}></Route>
        </Routes>
      </BrowserRouter>
    </div >
  );
};

export default App;
